import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Home from './pages/Home';
import AdminList from './pages/Admin/AdminList';
import NovoAdmin from './pages/Admin/NovoAdmin';
import EditarAdmin from './pages/Admin/EditarAdmin';
import AdminDetails from './pages/Admin/AdminDetails';  // ← import adicionado
import DonoList from './pages/Dono/DonoList';
import NovoDono from './pages/Dono/NovoDono';
import EditarDono from './pages/Dono/EditarDono';
import TutorList from './pages/Tutor/TutorList';
import NovoTutor from './pages/Tutor/NovoTutor';
import EditarTutor from './pages/Tutor/EditarTutor';
import PetList from './pages/Pet/PetList';
import NovoPet from './pages/Pet/NovoPet';
import EditarPet from './pages/Pet/EditarPet';
import PetDetails from './pages/Pet/PetDetails';
import NovoEvento from './pages/Evento/NovoEvento';
import ClienteHome from './pages/Cliente/ClienteHome';
import NovoEventoCliente from './pages/Evento/NovoEventoCliente';
import LoginCliente from './pages/Login/LoginCliente';
import LoginAdmin from './pages/Login/LoginAdmin';
import EscolhaPainel from './pages/Login/EscolhaPainel';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<EscolhaPainel />} />
        <Route path="/login-cliente" element={<LoginCliente />} />
        <Route path="/login-admin" element={<LoginAdmin />} />
        <Route path="/home" element={<Home />} />

        {/* Admin */}
        <Route path="/admins" element={<AdminList />} />
        <Route path="/admins/novo" element={<NovoAdmin />} />
        <Route path="/admins/:id" element={<AdminDetails />} />     {/* ← rota de detalhes */}
        <Route path="/admins/:id/editar" element={<EditarAdmin />} />

        {/* Dono */}
        <Route path="/donos" element={<DonoList />} />
        <Route path="/donos/novo" element={<NovoDono />} />
        <Route path="/donos/:id" element={<DonoDetails />} />     {/* se já existir DonoDetails */}
        <Route path="/donos/:id/editar" element={<EditarDono />} />

        {/* Tutor */}
        <Route path="/tutores" element={<TutorList />} />
        <Route path="/tutores/novo" element={<NovoTutor />} />
        <Route path="/tutores/:id" element={<TutorDetails />} />  {/* se já existir TutorDetails */}
        <Route path="/tutores/:id/editar" element={<EditarTutor />} />

        {/* Pet */}
        <Route path="/pets" element={<PetList />} />
        <Route path="/pets/novo" element={<NovoPet />} />
        <Route path="/pets/:id" element={<PetDetails />} />
        <Route path="/pets/:id/editar" element={<EditarPet />} />

        {/* Evento */}
        <Route path="/eventos/novo" element={<NovoEvento />} />

        {/* Cliente */}
        <Route path="/cliente" element={<ClienteHome />} />
        <Route path="/cliente/eventos/novo" element={<NovoEventoCliente />} />
      </Routes>
    </Router>
  );
}

export default App;
